} else if (value > 1000) {
	value = 1000;
}
return value;

settings.cardCss:
@import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@500&display=swap'); /* Clean futuristic font */

body {
    font-family: 'Orbitron', sans-serif;
    background-color: #0d0f1a; /* Dark background for contrast */
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    margin: 0;
}

.card {
    background-color: #1e293b; /* Simplified dark card background */
    color: #ffffff;
    width: 480px;
    height: 480px;
    padding: 40px;
    border-radius: 12px; /* Slightly rounded corners */
    box-shadow: 0 10px 20px rgba(0, 0, 0, 0.2); /* Subtle shadow */
    text-align: center;
}

.firmware-version {
    font-size: 18px;
    color: #fbc02d; /* Electric yellow to highlight the firmware version */
    margin-bottom: 20px;
}

.serial-number, .manufacturer-name {
    margin: 0;
    padding: 10px 0;
}

.serial-number {
    font-size: 18px;
    color: #9ea7b3; /* Soft silver color */
}

.manufacturer-name {
    font-size: 24px;
    color: #fbc02d; /* Electric yellow for emphasis */
    font-weight: 600;
    margin-bottom: 20px;
}

.meter-details p {
    font-size: 16px;
    color: #9ea7b3; /* Muted color for details at the bottom */
    margin: 5px 0;
}

